import React from "react";
import "./Card.css";
export default function Card({name, img, type,Types}){

   
    return(
        <div className="card">
                <h3 className="titleCard">{name}</h3>
                <div className="imgDivCard">
                <img src={img} alt="img not found" className="imgPoke"/>
                </div>
                <div className="typesDivCard">
                <h3 className="subtitleCard">Type:</h3>
                {
                    type.map(el=>(
                        <div className="types" key="el">
                            <h4>{el}</h4>
                        </div>
                    ))
                }
                {/* <h4 className="types">{type? type.join(', aaaaa') : Types.map(el=>el.name + ('')).join(',...ddsdsd ')}</h4> */}
            
                </div>
                
                
                
        
        </div>
        
    );
}
